import React, { useState } from "react";
const New = () => {
  const [materials, setMaterials] = useState([
    {
      label: "Cotton",
      value: "cotton",
    },
    {
      label: "Leather",
      value: "leather",
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ]);

  return (
    <div>
      <select onChange={(e)=> {
          const selectedMat = e.target.value
          setMaterials(selectedMat)
      }}>
        {materials.map((mat) => (
          <option value={mat.value}>
            {mat.label}
          </option>
        ))}
      </select>
      <h5>{materials.label}</h5>
      {materials}
    </div>
  );
};
export default New;
